"78903":{"id":"78903","name":"Utopia","slug":"utopia","original_title":"Utopia","overview":"Fãs de uma icônica revista de quadrinhos descobrem uma continuação secreta da história. Os jovens entram em caçada pelo manuscrito e descobrem qual o real significado da publicação.","first_air_date":"2020-09-25","episode_run_time":52,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Gillian Flynn"],"production_companies":["Amazon Studios","Kudos","Endemol Shine North America","Endemol Shine Group UK"],"genres":["Drama","Action & Adventure","Mistério"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/yYhu8ED3DxwzoLhdH5nlfMPJrXY.jpg","poster_path":"https://image.tmdb.org/t/p/original/oMY53BtS9vOTAhKgWr2gNYyLBOw.jpg","cast":["Javon Walton","Sasha Lane","Cory Michael Smith","Dan Byrd","John Cusack"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vWH9YwfPWiVB6c8duGlcHVDQplN.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vWH9YwfPWiVB6c8duGlcHVDQplN.jpg","air_date":"2020-09-25","episode_count":8,"overview":"N/A","vote_average":7.5,"episodes":{"1":{"name":"À nova vida","overview":"Quando uma rara e enigmática revista em quadrinhos surge por acaso, um grupo de fãs mal pode esperar para obtê-la. O que eles não sabem é que, com isso, estão se envolvendo em um perigo mortal.","air_date":"2020-09-25","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/yU2tuM5kdREp1ZwQLJ8E1Msf9tJ.jpg","vote_average":6.7},"2":{"name":"Só um fã","overview":"Nossos jovens fazem uma importante descoberta, que é abruptamente interrompida ao serem lançados no perigoso mundo de Jessica Hyde. Enquanto isso, dois médicos com trajetórias diferentes em suas carreiras veem-se reunidos pela força de uma gripe mortal.","air_date":"2020-09-25","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/l4ZWlXj69rsptLGfnT9136vb6IR.jpg","vote_average":7.7},"3":{"name":"Filhos da terça-feira","overview":"Jessica prossegue em sua busca por respostas. Enquanto isso, nosso excêntrico grupo deve tomar uma importante decisão. O Dr. Michael, por sua vez, cansado de ser tratado como uma marionete, resolve agir por conta própria.","air_date":"2020-09-25","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/duU1EB64AiEu8KqNsA65a22D9Mo.jpg","vote_average":7.9},"4":{"name":"Bom e rápido","overview":"Uma pista encontrada em Utopia leva Jessica e o grupo a um novo e misterioso aliado. Thomas cria um plano original para lidar com Michael enquanto Christie toma uma decisão.","air_date":"2020-09-25","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/qS0mYAdykMX2d0QgPVOv688o1yT.jpg","vote_average":7.7},"5":{"name":"Pedido 2472","overview":"Inserido na zona crítica de Saint Louis, Michael se vê obrigado a fazer uma escolha de vida ou morte. A situação fica cada vez mais perigosa, e Jessica se encontra frente a frente com alguém de seu passado.","air_date":"2020-09-25","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/lw1ai5iGv5CyXNezmmwUgGmhj2z.jpg","vote_average":7.4},"6":{"name":"Respeite o seu propósito","overview":"Jessica precisa se confrontar com uma revelação chocante sobre sua vida, e Arby questiona seu próprio passado. Michael descobre cada vez mais fatos em sua busca por respostas.","air_date":"2020-09-25","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/egsWRv30Isvgpp50KlOJiP7kUZf.jpg","vote_average":7},"7":{"name":"Falar machuca","overview":"Arby encontra um novo propósito, enquanto Becky toma uma decisão que separa o grupo. Michael está prestes a viver o pior dia de sua vida.","air_date":"2020-09-25","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/6XesRgbnnr7fbdRryBRkNVn7bzO.jpg","vote_average":7.8},"8":{"name":"Sobreviva, Jessica Hyde","overview":"No último episódio da temporada, o mundo aguarda ansiosamente pela vacina do Dr. Christie. Jessica e o grupo devem correr contra o tempo para deter a Ruína.","air_date":"2020-09-25","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/xsj4UkAcZTmGDzarrSVRD5fPGRd.jpg","vote_average":7.7}}}}},
