"220375":{"id":"220375","name":"A Agricultura do Futuro","slug":"a-agricultura-do-futuro","original_title":"Farm Rebellion","overview":"Benedikt Bösel era banqueiro de investimentos, mas a crise financeira chegou e, com ela, a busca por um propósito. Hoje, é agricultor e líder visionário de uma equipe de jovens que está testando um tipo de agricultura novo e radical na luta contra a mudança climática.","first_air_date":"2023-06-14","episode_run_time":0,"vote_average":6.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Martin Tischner"],"production_companies":["NEOS Film","Megaherz Film und Fernsehen","The Walt Disney Company EMEA"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/5nlaSE2D1wTF5fukqcKH2FSCFlu.jpg","poster_path":"https://image.tmdb.org/t/p/original/jKKhaznn7ZlAqaQeDUeCaQaDelS.jpg","cast":["Benedikt Bösel"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/jKKhaznn7ZlAqaQeDUeCaQaDelS.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/jKKhaznn7ZlAqaQeDUeCaQaDelS.jpg","air_date":"2023-06-14","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"As Vacas não Têm Culpa","overview":"Benedikt Bösel era banqueiro de investimentos, a crise financeira chegou e, com ela, a busca por um propósito. Hoje, é agricultor e um visionário que lidera uma equipe de jovens que testam um novo modelo radical de agricultura. Paula vê na fazenda a oportunidade de uma vida diferente. Já para José e Lea, esse é o primeiro passo rumo à construção da própria fazenda. É o começo de um ano e limites pessoais complicados. ","air_date":"2023-06-14","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/b6JhUOYA2301WEnyzu3dT76ENLi.jpg","vote_average":0},"2":{"name":"Você Colhe o que Planta","overview":"Após semanas sem chuva, a quarta safra ruim seguida está à espreita. Benedikt está colocando o legado de seus pais em risco? Durante sua visita, Auma Obama, agricultora pioneira no Quênia, aconselha o uso de lotes menores, assim como o guru das hortas comerciais Jean-Martin Fortier, hospedado por Anne e Deacon. Enquanto a pressão cresce, Benedikt precisa ir a Londres com a sua esposa Tess antes da colheita.","air_date":"2023-06-14","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/p8LMxEfwt0IchQcI9OcjatulcMz.jpg","vote_average":0},"3":{"name":"Da Fazenda à Mesa","overview":"Um fazendeiro que atira na própria vaca? O método de Benedikt para abater as vacas é polêmico. É correto comer carne e, se sim, de que tipo? A celebração do Dia de Ação de Graças se inicia com os preparos da chef Heidi Bjerkan. Um banquete para mais de 100 convidados foi planejado em pleno campo, mas será que isso vai dar certo? Enquanto isso, as dúvidas de Paula aumentam. A fazenda é o lugar certo para ela? ","air_date":"2023-06-14","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/uNL5CugH4pE1pUjlWm1izLg2kfe.jpg","vote_average":0},"4":{"name":"O Jardim do Éden","overview":"O humor muda no inverno: Paula pensa em se demitir. Anne e Deacon estão à beira da exaustão na fazenda Ackerpulco. José e Lea esperam outro filho. Até Rosi busca uma nova forma de elevar a sua motivação. Benedikt quer ajudá-la com isso oferecendo uma viagem à floresta tropical no Brasil, onde ambos se encontram com sua figura exemplar, Ernst Götsch, o mestre da agricultura sintrópica. ","air_date":"2023-06-14","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/p6pNIbQLlwrVSCWK0QwT0l6k7H2.jpg","vote_average":0},"5":{"name":"Escala Mundial","overview":"O otimismo retorna na primavera: Jojo viaja para Nova Iorque para aprender sobre a agricultura urbana com a pioneira Karen Washington, enquanto Benedikt se inspira com a ideia de “rewilding” ao lado dos especialistas Isabella Tree e Charlie Burrell, na Inglaterra. Tess tenta convencer Benedikt sobre a sua visão de um restaurante na fazenda, enquanto José e Lea arriscam um recomeço no Chile.","air_date":"2023-06-14","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/27BAEFHZtWGC3U6fuxJlV7xwg6B.jpg","vote_average":0},"6":{"name":"O Cultivo da Esperança","overview":"O ciclo se encerra no início do verão. Um ano de trabalho árduo por uma forma melhor de agricultura. O que Benedikt e a sua equipe realizaram? Seu pai traz um assunto delicado: no fim das contas, a fazenda precisa ter lucros. José e Lea começam a construir a base da futura fazenda no Chile. Já para Paula, um ano repleto de busca por propósito chega ao fim com uma viagem emocionante ao Quênia para se encontrar com Auma Obama. ","air_date":"2023-06-14","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/fAqLOHWYCUBjr9KOhsyrutHQk9c.jpg","vote_average":0}}}}},
