"195359":{"id":"195359","name":"Transatlântico","slug":"transatlantico","original_title":"Transatlantic","overview":"Durante a Segunda Guerra, dois americanos e seus aliados montam uma operação em Marselha para ajudar refugiados, artistas e escritores a fugir da Europa.","first_air_date":"2023-04-07","episode_run_time":50,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Anna Winger","Daniel Hendler"],"production_companies":["Studio Airlift"],"genres":["Drama","War & Politics"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/cfAikf2oculqqanLUFv76Yw3PEg.jpg","poster_path":"https://image.tmdb.org/t/p/original/iWJMIgpnKUkSMWoTzXJvM1l4pRi.jpg","cast":["Gillian Jacobs","Cory Michael Smith","Lucas Englander","Corey Stoll","Ralph Amoussou"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/iWJMIgpnKUkSMWoTzXJvM1l4pRi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/iWJMIgpnKUkSMWoTzXJvM1l4pRi.jpg","air_date":"2023-04-07","episode_count":7,"overview":"N/A","vote_average":5.7,"episodes":{"1":{"name":"Princípio da mão oculta","overview":"Em 1940, na cidade de Marselha, os americanos Mary-Jayne Gold e Varian Fry decidem recorrer a métodos não convencionais para ajudar os refugiados.","air_date":"2023-04-07","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/9CvJgI0kwRWVFTgHKz5KqDLTSpF.jpg","vote_average":6},"2":{"name":"O anjo da história","overview":"Uma surpresa desagradável obriga Varian e Mary-Jayne a procurar novas acomodações. Lisa lidera uma expedição perigosa pelas montanhas.","air_date":"2023-04-07","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/ixRZkUwyRv4yJUd4B2ParqHzzJU.jpg","vote_average":6.714},"3":{"name":"O deserto","overview":"Mary-Jayne assume uma missão secreta arriscada. No Villa Air-Bel, o artista Max Ernst dá uma festa de aniversário memorável.","air_date":"2023-04-07","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/zkUbCOAJ8qtzYFDbVv9naFPqT3l.jpg","vote_average":5.286},"4":{"name":"Sem volta","overview":"Oficiais nazistas provocam pânico durante uma ação policial, e Albert precisa tirar o escritor Walter Mehring da cidade. Varian encontra um velho amigo.","air_date":"2023-04-07","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/5yicTZ6uNtQcf753zek1GDRKT7C.jpg","vote_average":6.167},"5":{"name":"A condição humana","overview":"Pressionada por Margaux, Mary-Jayne planeja uma fuga da prisão. Thomas e uma nova moradora da vila incentivam Varian a viver de acordo com seus ideais.","air_date":"2023-04-07","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/mQqKw0oLVKRjZH4IiyZueztSwYU.jpg","vote_average":6},"6":{"name":"Automatismo psíquico puro","overview":"Varian corre contra o tempo para levar passageiros até o navio de Dubois. Albert e Paul mudam os planos após descobrirem algo assustador.","air_date":"2023-04-07","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/s7Vj8g3UY6N85jrmUe46cRQARib.jpg","vote_average":5.8},"7":{"name":"Incêndio na neve","overview":"Petit planeja uma operação de resgate desesperada. Mary-Jayne, Albert e Varian percebem que já não é seguro ficar em Marselha e enfrentam decisões bem difíceis.","air_date":"2023-04-07","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/5i3UgTKPrMD1EGVmRjbJ5aeE66Q.jpg","vote_average":4}}}}},
"119988":{"id":"119988","name":"O Inocente","slug":"o-inocente","original_title":"El inocente","overview":"Uma morte acidental lança um homem em uma espiral de intrigas e assassinato. Ele encontra o amor e recupera a liberdade, mas um telefonema traz de volta o seu passado.","first_air_date":"2021-04-30","episode_run_time":60,"vote_average":7.708,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Oriol Paulo","Jordi Vallejo"],"production_companies":["Sospecha Films","Think Studio"],"genres":["Crime","Mistério","Drama"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/gB9l7epUG4lZKe68bTdL6u6eZCK.jpg","poster_path":"https://image.tmdb.org/t/p/original/1u6MAHNAgheFMxTt9YF9bz9KHQH.jpg","cast":["Mario Casas","Alexandra Jiménez","Aura Garrido","Jose Coronado","Martina Gusmán"],"trailer":"NJYAIid7mNs","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/7pHbw1XvLwzqPgF5uM533c2VOpi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/7pHbw1XvLwzqPgF5uM533c2VOpi.jpg","air_date":"2021-04-30","episode_count":8,"overview":"N/A","vote_average":7.1,"episodes":{"1":{"name":"Episódio 1","overview":"A vida de Mat sai dos eixos quando ele se envolve em uma briga e mata acidentalmente um homem. Anos depois, a felicidade finalmente parece estar ao seu alcance.","air_date":"2021-04-30","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/4yL9VNX9IxoWXxbvNnv4WNTlGF7.jpg","vote_average":6.8},"2":{"name":"Episódio 2","overview":"Ao investigar o suposto suicídio de uma freira no orfanato católico em que foi criada, Lorena descobre que a freira não é quem dizia ser.","air_date":"2021-04-30","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/tajBTqpgonHJpk82jm9I830IWOm.jpg","vote_average":6.4},"3":{"name":"Episódio 3","overview":"Mat contrata Zoe, uma detetive particular, para encontrar Olivia. Lorena tenta descobrir o papel de Mat na morte da misteriosa freira.","air_date":"2021-04-30","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/f12Xn70cuSljvxpJcNWxIsk5awY.jpg","vote_average":7},"4":{"name":"Episódio 4","overview":"Agentes federais levam o corpo da freira, enfurecendo Lorena. Zoe descobre o paradeiro de Olivia.","air_date":"2021-04-30","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/dJE9BCPNOW5Di672mPlMVuuPVNY.jpg","vote_average":7.2},"5":{"name":"Episódio 5","overview":"Os agentes federais tentam tirar Lorena do caso. Olivia faz uma confissão chocante.","air_date":"2021-04-30","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/jUHgiInauwQSOYmgNZemVjylu1S.jpg","vote_average":7},"6":{"name":"Episódio 6","overview":"Os agentes federais detêm Olivia. Eles querem negociar um acordo, então a levam para casa, e não para a prisão. Mat vai a Marbella.","air_date":"2021-04-30","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/vwNqk5T14S7BTJUs1FoW8iF8l9d.jpg","vote_average":7.2},"7":{"name":"Episódio 7","overview":"Olivia reencontra uma velha amiga. Frustrada, Lorena abre mão de seu distintivo, mas volta atrás quando recebe uma oferta interessante.","air_date":"2021-04-30","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/4LCdnygQ5bXyWrb4aZfz2nL4A5j.jpg","vote_average":7.5},"8":{"name":"Episódio 8","overview":"Kimmy passa as informações para Olivia. Mat acha que está livre, mas surgem novas acusações, e ele descobre quem está atrás dele.","air_date":"2021-04-30","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/o2Xf958jMUS7H7ggZLt7qYyGTD.jpg","vote_average":7.5}}}}},
